import React, { useState } from "react";

const Header = () => {
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);

  const toggleDropdown = () => {
    setIsDropdownOpen((prev) => !prev);
  };

  const handleLogout = () => {
    // Add your logout logic here
    console.log("Logout clicked");
  };

  return (
    <div className="bg-gray-800 p-4 flex justify-between items-center">
      <div className="App-logo">
        <div className="Content">
          <img
            src="/images/premium-logo-black@3x.png"
            alt="logo Premium"
            className="w-3/5"
          />
        </div>
      </div>
      <div className="Icons flex items-center space-x-4 text-white">
        <img src="/images/fr@2x.png" alt="Icon France" className="w-8 h-8" />
        <span>France</span>
        <div className="user-icon relative" onClick={toggleDropdown}>
          <img
            src="/images/picto-utilisateur-connecte.png"
            alt="Icon User"
            className="w-8 h-8 cursor-pointer"
          />
          {isDropdownOpen && (
            <div className="dropdown-menu absolute right-0 mt-2 bg-white border border-gray-300 shadow-lg z-10 rounded">
              <button
                onClick={handleLogout}
                className="block w-full text-left px-4 py-2 hover:bg-gray-200 rounded"
              >
                Logout
              </button>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default Header;
